The plot follows the adventures of a London teenager Luke Rutherford, who learns that he is the last descendant of the Van Helsing  line by the sudden arrival of his American godfather Rupert Galvin. 
Luke is charged with the role of smiting the gathering dark forces of the world whilst trying to live an ordinary life of exams and parties. 
Rupert Galvin helps train Luke with the assistance of Mina Harker, a blind vampiric concert pianist and authority on half-lives (i.e., vampires, demons, zombies, and werewolves).
 Luke's best friend Ruby also joins in on the action.

